function Customer() {
  return (
    <div>
      <main className="mt-5 pt-2">
        <div className="container-fluid">
          <div className="row">
            <div className="col-md-12 fw-bold fs-4 mt-1">Customer Deatils</div>
            <hr className="mt-3 mb-3"/>
          </div>
          <div className="row">
            <div className="col col-md-12">
              
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default Customer;
